commits.content:
.business {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      background-color: var(--color-green);
      border-radius: rem(32px);
   }
   &__header {
      display: flex;
      flex-direction: column;
      align-items: center;
      padding: rem(17px) rem(22px) 0 rem(22px);
   }
   &__paragraf {
      max-width: rem(330px);
      text-align: center;
      font-weight: 600;
      font-size: rem(32px);   
      color: var(--color-white);
      padding-bottom: rem(70px);
   }
   &__box-img {
      width: auto;
      height: auto;
      & img {
         width: 100%;
         height: 100%;
      }
   }
   .button {
      background-color: var(--color-white);
      color: var(--color-green);
      padding: rem(10px) rem(35px);
      margin-bottom: rem(32px);
      &:hover {
         background-color: #fff;
         box-shadow: 0px 2px 0 #30444E, 2px 4px 6px #30444E;
         transition: all 150ms linear;
      } 
   }
}

@media screen and (min-width:992px) {
   .business {
      &__wrapper {
         display: flex;
         justify-content: space-between;
         align-items: stretch;
         flex-direction: row;
         background-color: var(--color-green);
         border-radius: rem(32px);

      }
      &__header {
         align-items: flex-start;
         padding: rem(50px) 0 rem(60px) rem(50px);
      }
      &__paragraf {
         max-width: rem(510px);
         text-align: start;
         font-weight: 600;
         font-size: rem(32px);   
         color: var(--color-white);
         padding-bottom: rem(60px);
      }
   }
}
